import React from 'react';
import { Grid } from '@material-ui/core';
import ProductCard from './ProductCard/ProductCard';

function ProductList() {
    const products = [
        { id: 1, name: 'Shoes', description: 'Running Shoes', price: '$130' },
        { id: 2, name: 'Sandals', description: 'Birkenstocks', price: '$60' },
        { id: 3, name: 'Shoes', description: 'Running Shoes', price: '$130' },
        { id: 4, name: 'Sandals', description: 'Birkenstocks', price: '$60' },
        { id: 5, name: 'Shoes', description: 'Running Shoes', price: '$130' },
        { id: 6, name: 'Sandals', description: 'Birkenstocks', price: '$60' },
        { id: 7, name: 'Shoes', description: 'Running Shoes', price: '$130' },
        { id: 8, name: 'Sandals', description: 'Birkenstocks', price: '$60' },
    ]

    const displayProducts = products.map((product) => {
        return (<Grid item key={product.id} xs={12} sm={6} md={4} lg={3} >
            <ProductCard product={product} />
        </Grid>
        )
    })

    return (
        <div>
            <Grid container justifyContent="center" spacing={5}>
                {displayProducts}
            </Grid>
        </div>
    )
}

export default ProductList;
